import React from "react";
import {Card, Grid, GridColumn, CardContent, CardHeader, CardDescription} from "semantic-ui-react";


function Starships( {data} ) {
    return (
        <>
            <h1>Starships</h1>
            <Grid columns={3}>
                {data.map((starships,i) => {
                    return(
                        <GridColumn key={i}>
                            <Card>
                                <CardContent>
                                    <CardHeader>{starships.name}</CardHeader>
                                    <CardDescription>
                                        <strong>Name</strong>
                                        <p>{starships.name}</p>
                                        <strong>Model</strong>
                                        <p>{starships.model}</p>
                                        <strong>Lenght</strong>
                                        <p>{starships.lenght}</p>
                                    </CardDescription>
                                </CardContent>
                            </Card>
                        </GridColumn>
                    )
                })}
            </Grid>
        </>
    )
}
export default Starships;
